    },[])


    return <>
        {blogs && blogs.map && blogs.map((blog, i) => (
            <div className='list-group list-group-flush card' key={i}>
                <h2 className='list-group-item card-text'>
                    {blog.heading}
                </h2>
                <p className='list-group-item card-text'>
                    {blog.body}
                </p>
